package bd.edu.seu.messmanagmentsystem.repository;import bd.edu.seu.messmanagmentsystem.model.Manager;import bd.edu.seu.messmanagmentsystem.model.Name;import org.springframework.data.jpa.repository.Query;import org.springframework.data.repository.CrudRepository;import org.springframework.stereotype.Repository;import java.util.List;@Repositorypublic interface ManagerRepository extends CrudRepository<Manager,Long> {    List<Manager> findAllByName(Name name);    @Query(value = "select * from Manager where Facebook_Profile=?",nativeQuery = true)    Manager findByFacebook(String fb);    @Query(value = "select * from Manager where Country=?",nativeQuery = true)    List<Manager> findbyCountry(String country);}